import React from 'react';
import { NavigationContainer } from '@react-navigation/native';
import { createStackNavigator } from '@react-navigation/stack';
import LoginScreen from './Screens/LoginScreen'; // Assurez-vous que le chemin d'importation est correct
import ProductsScreen from './Screens/StockScreen'; // Assurez-vous que le chemin d'importation est correct

const Stack = createStackNavigator();

function App() {
  return (
    <NavigationContainer>
      <Stack.Navigator initialRouteName="Login">
        <Stack.Screen name="Login" component={LoginScreen} />
        <Stack.Screen name="Products" component={ProductsScreen} />
        {/* Ajoutez d'autres écrans si nécessaire */}
      </Stack.Navigator>
    </NavigationContainer>
  );
}

export default App;
